                <p>使用时请务必保留来源，请勿用于违反我国法律的web平台、如诈骗等非法平台网站。版权最终解释权归《NFine团队》所有</p>
                <p>NFine是一套基于ASP.NET MVC+EF6+Bootstrap开发出来的框架，源代码完全开源，可以帮助你解决C#.NET项目68%的重复工作，让开发人员远离加班！</p>
                <p>使用 Apache License 2.0 协议，采用主流框架，容易上手，简单易学，学习成本低。可完全实现二次开发、基本满足80%项目需求。</p>
