                <p>支持SQLServer、MySQL、Oracle、SQLite、Access 等多数据库类型。模块化设计，层次结构清晰。内置一系列企业信息管理的基础功能。</p>
                <p>操作权限控制精密细致，对所有管理链接都进行权限验证，可控制到导航菜单、功能按钮。</p>
                <p>数据权限（精细化数据权限控制，控制到行级，列表级，表单字段级，实现不同人看不同数据，不同人对同一个页面操作不同字段</p>
                <p>提高开发效率及质量。常用类封装，日志、缓存、验证、字典、文件、邮件、,Excel。等等，兼容目前最流行浏览器（IE8+、Chrome、Firefox、360浏览器）</p>
